import React, { useState } from 'react'

const TDL = () => {

const[data,setData]=useState("");
const[task,listTask]=useState([]);

const set=(event)=>
{
    setData(event.target.value);
}

const show=()=>
{
   listTask((preval)=>{
    return[...preval,data];
   })

}

  return (
    <>
    <input onChange={set}></input>
    <button onClick={show}>+</button>
    {task.map((val)=>
    {
        return<h1>{val}</h1>

    })
    
    }
    </>
  )
}

export default TDL;
